import Document, { Head, Main, NextScript } from 'next/document';

export default class SiteDocument extends Document {
    render () {
      return (
        <html>
          <Head>
            <meta charSet="utf-8" />
            <meta name="viewport" content="initial-scale=1.0, width=device-width" />
            <title>Reece Russell / Software Developer</title>
          </Head>
          <body>
          <style jsx global>{`
      body { 
        background: #000;
        font: 11px menlo;
        color: #fff;
      }
    `}</style>
            <Main />
            <NextScript />
          </body>
        </html>
      )
    }
  }
